export default function Login({ onLogin }) {
  const users = [
    "nick",
    "marvel",
    "america",
    "thanos",
    "thor",
    "travis"
  ];

  return (
    <div className="h-screen relative overflow-hidden">
      <div className="absolute inset-0 slider opacity-30">
        {[1,2,3,4].map(i => (
          <img
            key={i}
            src="https://images.unsplash.com/photo-1628294895950-9805252327bc"
            className="w-1/2 object-cover"
          />
        ))}
      </div>

      <div className="relative z-10 h-full flex items-center justify-center">
        <div className="bg-white p-10 rounded-xl shadow-xl w-96">
          <h2 className="text-2xl font-bold text-orange-600 mb-6 text-center">
            FoodDash Login
          </h2>

          {users.map(u => (
            <button
              key={u}
              onClick={() => onLogin(u)}
              className="w-full mb-3 bg-orange-500 hover:bg-orange-600 text-white py-2 rounded transition"
            >
              Login as {u}
            </button>
          ))}
        </div>
      </div>
    </div>
  );
}
